import React from 'react';

const LoginPage = () => {
    return (
        <Container fluid>
            {IsSinging ? <FullScreenLoading/> : <></>}
            <div className="row mt-5">
                <div className="col-md-5 col-lg-4 m-auto">
                    <div className="my-5 border border-1 ">
                        <div className="w-100 border-bottom border-1 py-3">
                            <h5 className="text-center">TimeManager | Authorization</h5>
                            {error ? <p className={"text-danger text-center"}>{error}</p> : <></>}
                        </div>
                        <form onSubmit={handleSubmit(SignIn)}>
                            <div className="mb-3 px-5 mt-2">
                                <label htmlFor="username" className="form-label">
                                    Username
                                </label>
                                <input
                                    type="text"
                                    className="form-control"
                                    placeholder={"Your username"}
                                    {...register('username', {
                                        required: true,
                                    })}
                                />
                                <span className={"text-danger mt-1 opacity-100"}>{errors?.username && "This field is required!"}</span>
                            </div>
                            <div className="mb-3 px-5">
                                <label htmlFor="password" className="form-label">
                                    Password
                                </label>
                                <input
                                    type="password"
                                    className="form-control"
                                    placeholder={"123456"}
                                    {...register('password',{
                                        required: true
                                    })}
                                />
                                <span className={"text-danger mt-1 opacity-100"}>{errors?.password && "This field is required!"}</span>
                            </div>
                            <div className="px-5 mb-3 padding-bottom">
                                <Button type={"submit"} variant={"secondary px-4"}>Sign In</Button>
                            </div>
                        </form>
                    </div>
                </div>
            </div>
        </Container>
    );
};

export default LoginPage;
